import React from "react";
import { Link } from "react-router-dom";

export default function Card({ image, name, temperament, weight, id }) {
  return (
    <div>
      <Link to={"/dog/" + id}>
        <img className="img" src={image.url} alt={image.name} />
      </Link>
      <h3>{name}</h3>
      <h5>{temperament}</h5>
      <h5>{weight}</h5>
    </div>
  );
}

